export const planetChartData = {
  type: "line",
  chartData: {
    labels: ["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"],
    datasets: [
      {
        label: "Expected",
        data: [90, 120, 161, 134, 105, 160, 165],
        backgroundColor: "rgba(54,73,93,.5)",
            borderColor: "#36495d",
        fill: false,
        borderWidth: 2,
        tension: 0.1
      },
      {
        label: "Actual",
        data: [118, 82, 91, 154, 162, 140, 145],
        backgroundColor: "rgba(71, 183,132,.5)",
        borderColor: "#47b784",
        borderWidth: 2,
        tension: 0.1
      }
    ]
  },
  options: {
    responsive: true,
    lineTension: 1,
      scales: {
        yAxes: [
            {
                ticks: {
                    beginAtZero: true,
                    padding: 0
                }
            }
        ],

    }
  }
};

export default planetChartData;
